    true,nt"url": null,nt"notes": "<p>2001 to 2013.  NVSS is a secure, web-based
    data management system that collects and disseminates the Nation's official vital
    statistics. Data for this dataset has been computed by personnel in CDC's Division
    for Heart Disease and Stroke Prevention (DHDSP).  This dataset is one of the datasets
    provided by National Cardiovascular Disease Surveillance System. The system is designed
    to integrate multiple indicators from many data sources to provide a comprehensive
    picture of the public health burden of CVDs and associated risk factors in the United
    States. The data are organized by location (national, state, region, and selected
    sites) and indicator; NVSS mortality data include CVDs (e.g., heart failure). The
    data can be viewed by temporal trends and stratified by age group, sex, and race/ethnicity.</p>n",nt"license_title":
